pickaword()
  { 
    WORDLENGTH=$1; 
    FREQSUM=$( (echo "$WORDS") |  awk -v wordlength="$WORDLENGTH" 'length($1) == wordlength {s+=$2}END{print s}')
    CHOICE=$(shuf -i 0-$FREQSUM -n 1);
    (echo "$WORDS") | awk -v wordlength="$WORDLENGTH" 'length($1) == wordlength {sum += $2; print $1, $2, sum} END {print sum}' | awk -v threshold="$CHOICE" '$3 < threshold' | tail -2 | head -1 | cut -f1 -d' ';
    
    }

wordsByLength()
{
    WORDLENGTH=$1; 
    ( (echo "$WORDS") |  awk -v wordlength="$WORDLENGTH" 'length($1) == wordlength {print $1}')
}